import React,{useEffect} from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { jobList } from '../../redux/action/jobAction';
import Card from '../card/card';

const ListJob = () => {
    const dispatch = useDispatch()
    const {getListJob,getListJobLoading,getListJobError} = useSelector((state) => state.JobReducer)
    console.log(getListJob)
    useEffect(() => {
        // paggil
       console.log('komponen didmount')
        dispatch(jobList())
    }, [dispatch])

    return (
        <div className='container'>
            <h5>1-30 dari 41.923 lowongan</h5>
            
            {getListJob ?(
                getListJob.map((job)=>{
                    return(
                        <div>
                            <Card title={job.title} company={job.company}/>
                        </div>
                    )
                })
            ) : 'loading'}
        </div>
    );
}

export default ListJob;
